eqnarray:
\begin{eqnarray}
\delta A_0 &=& i\Psi^T \epsilon ,   \n \\
\delta X_I&=& i\Psi^T \gamma_I \epsilon , \n \\
\delta \Psi &=& \left( D_0 X_I \gamma_I  -\frac{i}{2}
[X_I,X_J]\gamma_{IJ} \right)\epsilon \n\\
&+&\left(\frac{\mu}{3}\sum_{a=5,6,7} X_a\gamma_a
\gamma_{567} -\frac{\mu}{6}\sum_{s=1,2,3,4,8,9} X_s\gamma_s
\gamma_{567}
\right) \epsilon.
\

\begin{eqnarray}
 S_E &=& {1 \over 2} \int d \tau  {\rm Tr} \left\{ \left(\mp D_\tau X_5 +
    \left({1\over 2} \sum_f \bar q_2^{(f)} q_2^{(f)}
        + {\mu \over 3} X_5 \right) \right)^2  \right. \n\\
    &{}& \qquad  \left. + \sum_f
       \left(\mp D_\tau \bar q_2^{(f)} +
        \left(X_5 + {\mu \over 3}\right) \bar q_2^{(f)} \right)
       \left(\mp D_\tau  q_2^{(f)} +  q_2^{(f)} \left(X_5
        + {\mu \over 3}\right)  \right) \right\} \n \\
     &{}& \pm {1 \over 2} \int d \tau {\rm Tr}
      \left\{ \left(2 D_\tau X_5 \right)
      \left({1\over 2} \sum_f \bar q_2^{(f)} q_2^{(f)}
      +  + {\mu \over 3} X_5 \right)  \right. \n\\
     &{}& \qquad \left. +\sum_{(f)} D_\tau \bar q_2^{(f)}
      \left(X_5 + {\mu \over 3} \right)
     q_2^{(f)} + \sum_f \left(X_5 + {\mu \over 3} \right)  \bar q_2^{(f)}
     D_\tau q_2^{(f)} \right\} \n \\
  &\geq& \pm {1\over 2} \int d \tau {d \over d\tau} {\rm Tr}
     \left({\mu \over 3} X_5^2 + {\mu \over 3}\sum_f \bar q_2^{(f)} q_2^{(f)}
       + X_5\sum_f \bar q_2^{(f)} q_2^{(f)} \right) \n \\
   &=& \pm{1 \over 2} {\rm Tr} \left( {\mu \over 3} X_5^2
      + {\mu \over 3}\sum_f \bar q_2^{(f)} q_2^{(f)}
       + X_5\sum_f \bar q_2^{(f)} q_2^{(f)}
    \right) \Biggr\vert_{-\infty}^{+\infty}.
\

\begin{eqnarray}
 \pm D_\tau X_5 &=& {1\over 2} \sum_f \bar q_2^{(f)} q_2^{(f)}
             + {\mu \over 3} X_5 ,\n \\
 \pm D_\tau \bar q_2^{(f)} &=& X_5  \bar q_2^{(f)}
  + {\mu \over 3} \bar q_2^{(f)}.
\

\begin{eqnarray}
\label{x5}
 \pm D_\tau X_5 &=& {1\over 2} \sum_f \bar q_2^{(f)} q_2^{(f)}
             + {\mu \over 3} X_5 + {1 \over 2} \left[\bar y_2, y_2 \right]  ,\\
\label{q2}
 \pm D_\tau \bar q_2^{(f)} &=& X_5  \bar q_2^{(f)}
  + {\mu \over 3} \bar q_2^{(f)}  , \\
  \label{y2}
 \pm D_\tau \bar y_2 &=& \left[ X_5 , \bar y_2 \right] + {\mu \over 3}
  \bar y_2.
\

\begin{eqnarray}
  S_E \approx {1 \over 6} N p^3 = {R_s^3 p^3 \over 6 \pi l_p^3}
  = {y_p^3 \over 6 \pi l_p^3} .
 \

\begin{eqnarray}
  S_E \approx {1\over 3} N p^{3 \over 2} ={R_s^6 \over 96 \pi^2
  l_p^6} p^{3 \over 2}
   ={z_p^6 \over 96 \pi^2 l_p^6}.
 \

